import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='principal column'>
                <div className='cabezera row'>
                    <div >Logo</div>
                    <div >rutas</div>
                </div>
                <div className='contenido row'>
                    contenido
                </div>
            </div>
            <style jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }  
            `}</style>
        </Layout>
    );
}

export default dashboard;
